    y[17] = x[17]*30.026490*XWinv; 
    y[18] = x[18]*31.034460*XWinv; 
    y[19] = x[19]*31.034460*XWinv; 
    y[20] = x[20]*32.042430*XWinv; 
    y[21] = x[21]*26.038240*XWinv; 
    y[22] = x[22]*27.046210*XWinv; 
    y[23] = x[23]*28.054180*XWinv; 
    y[24] = x[24]*29.062150*XWinv; 
    y[25] = x[25]*30.070120*XWinv; 
