    y[28] = x[28]*43.045610*XWinv; 
    y[29] = x[29]*28.013400*XWinv; 
    y[30] = x[30]*19.022761*XWinv; 
    y[31] = x[31]*29.017971*XWinv; 
    y[32] = x[32]*43.045061*XWinv; 
    y[33] = x[33]*33.049851*XWinv; 
    y[34] = x[34]*17.007919*XWinv; 
