    cpms[8] *= 6.922286890225532e+06; /*C */
    cpms[9] *= 6.386347631908485e+06; /*CH */
    cpms[10] *= 5.927432288630956e+06; /*CH2 */
    cpms[11] *= 5.927432288630956e+06; /*CH2(S) */
